import React,{Component} from 'react';
import './work.css';
import 'tachyons';
import { BiMobile ,BiLaptop} from "react-icons/bi";
import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Carousel} from 'react-bootstrap';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';
import image1 from '././testimonials/1.png';
import image2 from '././testimonials/2.png';
import image3 from '././testimonials/3.png';

class Work extends Component {
  constructor() {
    super();}
  render(){

    return (
      <div  className="home1">
      <h1 className="pa3 ml3">Projects completed </h1>
      <div className="bb bw2 center" ></div>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <div className="website">

      <Carousel>

      <Carousel.Item>
      <div className=" ml6 projects">

              <div className="bg-white dib br4 pa3 ma3 grow shadow-5 w-25 ml4 mt4">
              <img src={image3} alt="project sharva" width="270px" height="200px" className="pa2 center"/>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse tincidunt, sapien sit amet accumsan aliquam,
              eros ipsum vehicula ligula, in luctus nisi tortor in ligula. </p>
              <a href="https://inmotionhosting.com" ><button className="btn ml5 mb2"  role="button">View Website</button></a>
              </div>

             <div className="bg-white dib br4 pa3 ma3 grow shadow-5 w-25 ml4 mt4 ">
             <img src={image1} alt="project sharva" width="270px" height="200px" className="pa2 center"/>
             <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse tincidunt, sapien sit amet accumsan aliquam,
             eros ipsum vehicula ligula, in luctus nisi tortor in ligula. </p>
             <a href="https://inmotionhosting.com" className="btn ml5 mb2"  role="button">View Website</a>
             </div>

             <div className="bg-white dib br4 pa3 ma3 grow shadow-5 w-25 ml4 mt4">
             <img src={image2} alt="project sharva" width="270px" height="200px" className="pa2 center"/>
             <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse tincidunt, sapien sit amet accumsan aliquam,
             eros ipsum vehicula ligula, in luctus nisi tortor in ligula. </p>
             <a className="btn ml5 mb2" href="#" role="button">View Website</a>
             </div>

           </div>
            &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      </Carousel.Item>
      </Carousel>
      </div>
        </div>
    );
  }
}
export default Work;
